import React, { useState, useEffect } from 'react';
import { View, Image, ImageBackground, Text, TouchableOpacity, Picker } from 'react-native';
import { RectButton, ScrollView, TextInput } from 'react-native-gesture-handler';
import { useNavigation } from '@react-navigation/native';
import { useRoute } from '@react-navigation/native';

import styles from './estilo';
import styleGeral from '../../estiloGeral/style'

export default function tCadastroLocalU() {

    const route = useRoute();

    const [nome, setnome] = useState(route.params?.nome); //1
    const [sobrenome, setsobrenome] = useState(route.params?.sobrenome); //2
    const [data_de_nasc, setdata_de_nasc] = useState(route.params?.data_de_nasc);//3
    const [cpf, setcpf] = useState(route.params?.cpf || ''); //4
    const [sexo, setsexo] = useState(route.params?.sexo || ''); //5
    const [celular, setcelular] = useState(route.params?.celular || '');//6
    const [email, setemail] = useState(route.params?.email || '');//7
    const [senha, setsenha] = useState(route.params?.senha || '');//8

    const [cep, setCep] = useState("") //11
    const [logradouro, setLogradouro] = useState("") //12
    const [localidade, setLocalidade] = useState("")//13
    const [uf, setUf] = useState("")//14

    const Estado = [
        { label: 'Acre', value: 'AC' },
        { label: 'Alagoas', value: 'AL' },
        { label: 'Amapá', value: 'AP' },
        { label: 'Amazonas', value: 'AM' },
        { label: 'Bahia', value: 'BA' },
        { label: 'Ceará', value: 'CE' },
        { label: 'Distrito Federal', value: 'DF' },
        { label: 'Espírito Santo', value: 'ES' },
        { label: 'Goiás', value: 'GO' },
        { label: 'Maranhão', value: 'MA' },
        { label: 'Mato Grosso', value: 'MT' },
        { label: 'Mato Grosso do Sul', value: 'MS' },
        { label: 'Minas Gerais', value: 'MG' },
        { label: 'Pará', value: 'PA' },
        { label: 'Paraíba', value: 'PB' },
        { label: 'Paraná', value: 'PR' },
        { label: 'Pernambuco', value: 'PE' },
        { label: 'Piauí', value: 'PI' },
        { label: 'Rio de Janeiro', value: 'RJ' },
        { label: 'Rio Grande do Norte', value: 'RN' },
        { label: 'Rio Grande do Sul', value: 'RS' },
        { label: 'Rondônia', value: 'RO' },
        { label: 'Roraima', value: 'RR' },
        { label: 'Santa Catarina', value: 'SC' },
        { label: 'São Paulo', value: 'SP' },
        { label: 'Sergipe', value: 'SE' },
        { label: 'Tocantins', value: 'TO' },
    ];

    const navigation = useNavigation();

    async function BuscarCep() {
        let url = `https://viacep.com.br/ws/${cep}/json/`;

        let req = await fetch(url);
        let res = await req.json();

        setLogradouro(res.logradouro);
        setLocalidade(res.localidade);

        const estadoEncontrado = Estado.find((estado) => estado.value === res.uf);
        if (estadoEncontrado) {
            setUf(estadoEncontrado.value);
        } else {
            setUf("");
        }
    }

    function handleNavigate() {
        navigation.navigate('tCadastroFotoU', {
            nome: nome, sobrenome: sobrenome, celular: celular, cpf: cpf, email: email, senha: senha, sexo: sexo, data_de_nasc: data_de_nasc, logradouro: logradouro, localidade: localidade, uf: uf, cep: cep,
        });
    }

    function Voltar() {
        navigation.goBack()
    }

    return (
        <ImageBackground style={styleGeral.container}>
            <View style={styles.marginTop}>
                <Image style={{ width: 100, height: 109, marginTop: -30 }}
                    source={require('../../../assets/logo.png')} />
            </View>

            <View>
                <Text style={styles.title}>Cadastro Usuário</Text>
            </View>

            <ScrollView>
                <View style={styles.footer}>

                    <TextInput
                        style={styles.input}
                        value={cep}
                        onChangeText={(texto) => setCep(texto)}
                        placeholder='Cep'
                    />

                    <TouchableOpacity style={styles.buttonNext}>
                        <Text style={styles.buttonText} onPress={BuscarCep}>Buscar</Text>
                    </TouchableOpacity>

                    <Picker
                        style={styles.input}
                        selectedValue={uf}
                        onValueChange={(itemValue) => {
                            setUf(itemValue);
                            const estado = Estado.find((estado) => estado.label === itemValue);
                        }}
                    >
                        {Estado.map((opcao) => (
                            <Picker.Item
                                key={opcao.value}
                                label={opcao.label}
                                value={opcao.value}
                            />
                        ))}
                    </Picker>

                    <TextInput
                        style={styles.input}
                        value={localidade}
                        onChangeText={(texto) => setLocalidade(texto)}
                        placeholder="Cidade"
                    />

                    <TextInput
                        style={styles.input}
                        value={bairro}
                        onChangeText={(texto) => setBairro(texto)}
                        placeholder="Bairro"
                    />

                    <TextInput
                        style={styles.input}
                        value={logradouro}
                        onChangeText={(texto) => setLogradouro(texto)}
                        placeholder="Endereço"
                    />

                </View>
            </ScrollView>

            <View>
                <RectButton style={styles.buttonNext} onPress={handleNavigate}>
                    <Text style={styles.buttonText}>Avançar</Text>
                </RectButton>

                <RectButton style={styles.buttonReturn} onPress={Voltar}>
                    <Text style={styles.buttonText}>Voltar</Text>
                </RectButton>
            </View>
        </ImageBackground >
    );
}
